%[text] # Circular winding lateral misalignment
clc;
clear;
%[text] ## Definitions
% Tx winding - assume circular spiral winding with 1 layer
R_tx_outer = 0.025;     % Outer radius of Tx winding
R_tx_inner = 0.015;     % Inner radius of Tx winding
N_tx = 10;              % Tx winding number of turns
r_tx_cs = 0.00045;      % Radius of wire's cross-section for Tx winding

% Rx winding - assume circular spiral winding with 1 layer
R_rx_outer = 0.025;     % Outer radius of Rx winding
R_rx_inner = 0.015;     % Inner radius of Rx winding
N_rx = 10;              % Rx winding number of turns
r_rx_cs = 0.00045;      % Radius of wire's cross-section for Rx winding

% Simulation parametrics
delta_z = 0.01:0.005:0.05;          % Raised height of Rx coil
delta_x = linspace(0, 0.05, 101);   % Misalignment on x-axis
%[text] ## Function for simulation calling ivsolver executable
function [L_tx, L_rx, M] = CalculateInductance(KP1, rcs1, KP2, rcs2, Offset)
    indef = 'wires.def'; 
    fid = fopen(indef, 'w'); % Open the file for writing
    if fid == -1
        error('Cannot open file: %s', indef);
    end

    fprintf(fid, '2\r\n%d 1\r\ns %d\r\n', rcs1, length(KP1));
    for i = 1:length(KP1)
        fprintf(fid, '%d %d %d\r\n', KP1(1, i), KP1(2, i), KP1(3, i));
    end

    fprintf(fid, '%d 2\r\ns %d\r\n', rcs2, length(KP2));
    for i = 1:length(KP2)
        fprintf(fid, '%d %d %d\r\n', KP2(1, i), KP2(2, i), KP2(3, i));
    end
    fprintf(fid, 'o\r\n%d %d %d\r\n', Offset(1), Offset(2), Offset(3));

    fclose(fid);

    L_tx = 0;
    L_rx = 0;
    M = 0;
    
    [status, cmdout] = system('../../../build/ivsolver wires.def wires.out');
    
    if status ~= 0
        fprintf(cmdout);
    else
        lmat = load('wires.out.lmat');
        
        %%% UNCOMMENT TO PLOT WINDING TRAJECTORIES %%
        % out_trj1 = load('wires.out_0.trj');
        % out_trj2 = load('wires.out_1.trj');
        % figure;
        % hold('on');
        % 
        % plot3(out_trj1(:,1), out_trj1(:,2), out_trj1(:,3));
        % plot3(out_trj2(:,1), out_trj2(:,2), out_trj2(:,3));
        % 
        % view(45, 30);
        % xlim([-0.05, 0.05]);
        % ylim([-0.05, 0.05]);
        % zlim([-0.02, 0.04]);
        % 
        % axis('equal');
        % 
        % pause;

        L_tx = lmat(1,1);
        L_rx = lmat(2,2);
        M = lmat(1,2);
    end
end
%[text] ## Simulation
% Output variables
M = zeros(length(delta_z), length(delta_x));
k = M;

x_ticks = linspace(R_tx_inner, R_tx_outer, N_tx + 1);
KP1 = zeros(3, N_tx + 1);
for i = 1:(N_tx + 1)
    KP1(1, i) = x_ticks(i);
    KP1(2, i) = 0;
    KP1(3, i) = 0;
end

x_ticks = linspace(R_rx_inner, R_rx_outer, N_rx + 1);
KP2 = zeros(3, N_rx + 1);
for i = 1:(N_rx + 1)
    KP2(1, i) = x_ticks(i);
    KP2(2, i) = 0;
    KP2(3, i) = 0;
end

% Big loop
Offset = [0;0;0];

for j = 1:length(delta_z)
    for i = 1:length(delta_x)
        Offset(1) = delta_x(i);
        Offset(3) = delta_z(j);
        [L_tx, L_rx, Mut] = CalculateInductance(KP1, r_tx_cs, KP2, r_rx_cs, Offset);
        M(j,i) = Mut;
        k(j,i) = Mut/L_tx;
    end
end

figure; %[output:233d27fb]
hold('on'); %[output:233d27fb]
title('Coupling coefficienct vs. lateral misalignment'); %[output:233d27fb]
xlabel('Misalignment (cm)'); %[output:233d27fb]
ylabel('Coupling coefficient k'); %[output:233d27fb]
for j = 1:length(delta_z)
    plot(delta_x*100, k(j,:)); %[output:233d27fb]
end

legendTextArray = arrayfun(@(x) sprintf('Height = %.2g cm', x), delta_z.*100, 'UniformOutput', false);
legend(legendTextArray); %[output:233d27fb]

